// ==UserScript==
// @name         Playground Links
// @namespace    http://tampermonkey.net/
// @version      0.3
// @description  Adds links to our playgrounds and jira tickets to the PR title.
// @author       You
// @match        https://github.com/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=github.com
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    const getTitleElement = () => document.querySelector('.gh-header-title')

    function onLocationChange()
    {
        initPr();
    }

    function initPr()
    {
        if(!/RogerAI\/.*\/pull\/\d/.test(window.location.pathname)) return;
        addJiraLink();
        addPlaygroundLink();
    }


    function addPlaygroundLink()
    {
        // Check title for playground tag
        const titleElem = getTitleElement();
        if(!titleElem) return;
        const titleText = titleElem.textContent ?? "";
        if(!/\[playground\]/i.test(titleText)) return;

        // Check for an existing link
        const existingLink = document.querySelector('#playground-link');
        if(existingLink) return;

        let playgroundLink = document.createElement('span');
        playgroundLink.setAttribute("id", "playground-link");
        let prNumber = document.querySelector('.gh-header-title .f1-light').textContent.replace('#','');
        playgroundLink.innerHTML = `
          <a href="https://pr-${prNumber}.playgrounds.corpayone.com/" target="_blank">
            <img src="${dataUris.playground}" alt="star" width="24" height="24">
          </a>`;

        titleElem.append(' ');
        titleElem.append(playgroundLink)
    }

    function addJiraLink()
    {
        const titleElem = getTitleElement();
        if(!titleElem) return;
        const titleText = titleElem?.textContent;
        const match = titleText.match(/\[([A-Za-z]+\-\d+)\]/)
        if(!match.length) return;
        const ticketId = match[1];

        // Check for an existing link
        const existingLink = document.querySelector('#jira-link');
        if(existingLink) return;

        let jiraLink = document.createElement('span');
        jiraLink.setAttribute("id", "jira-link");
        jiraLink.innerHTML = `
<a
  href="https://roger-team.atlassian.net/browse/${ticketId}"
  target="_blank"
  style="text-decoration: none !important"
>
  <img
    src="${dataUris.jira}"
    width="24"
    height="24"
  />
</a>`;

        titleElem.append(' ');
        titleElem.append(jiraLink)
    }

    function initialize()
    {
        console.log("Initializing Playground Link Script");
        let oldPushState = history.pushState;
        history.pushState = function pushState() {
            let ret = oldPushState.apply(this, arguments);
            window.dispatchEvent(new Event('pushstate'));
            window.dispatchEvent(new Event('locationchange'));
            return ret;
        };

        let oldReplaceState = history.replaceState;
        history.replaceState = function replaceState() {
            let ret = oldReplaceState.apply(this, arguments);
            window.dispatchEvent(new Event('replacestate'));
            window.dispatchEvent(new Event('locationchange'));
            return ret;
        };

        window.addEventListener('popstate', () => {
            window.dispatchEvent(new Event('locationchange'));
        });

        window.addEventListener('locationchange', function () {
            onLocationChange();
        });

        // this is lazy but we'll loose the links if the title is edited
        initPr();
        setInterval(() => initPr(), 250);
    }

    const dataUris = {
        jira: "data:image/x-icon;base64,",
        playground: "data:image/png;base64,",
    }

    initialize();
})();